import Button from "../components/Button";
import Card from "../components/DemoCard";
import "../styles/login.css";

const Login = () => {
  return (
    <div className="login-card">
      <Card />
      <div className="login-box w-75">
        <div>
         <Button text="Continue with Google" />
          <br />
          <button className="login-button twitter">
            Continue with X (formerly Twitter)
          </button>
        </div>
        <div className="separator">OR</div>
        <button className="login-button metamask">Metamask</button>
        <button className="login-button walletconnect">WalletConnect</button>
      </div>
      <div className="footer">Powered by Tria</div>
    </div>
  );
};

export default Login;
